import Setup from "./Setup";

class Method{
    private name: string;
    private specificPC: string;
    private setups: Setup[];
    constructor(name: string, specificPC:string, setups: Setup[]) {
        this.name = name;
        this.specificPC = specificPC;
        this.setups = setups;
    }

    setName(name: string) {
        this.name = name;
    }
    getName() {
        return this.name;
    }

    setSpecificPC(specificPC: string) {
        this.specificPC = specificPC;
    }
    getSpecificPC() {
        return this.specificPC;
    }

    addSetup(setup:Setup){
        this.setups.push(setup);
    }    
    getSetups(): Setup[] {
        return this.setups;
    }
}

export default Method;
